import React, { Component } from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import { Navbar, Nav } from "react-bootstrap";

import * as actions from "../actions";

class Header extends Component {
  constructor(props) {
    super(props);
    this.signOut = this.signOut.bind(this);
  }
  signOut() {
    this.props.SignOut();
  }
  render() {
    return (
      <div>
        <Navbar expand="sm">
          <Link className="navbar-brand links" to="/">
            SecPark
          </Link>
          <Navbar.Toggle aria-controls="navbar ml-auto" />
          <Navbar.Collapse id="navbar">
            <Nav className="ml-auto">
              {!this.props.isAuth ? (
                <>
                  <Link className="nav-link links" to="/SignUp">
                    Sign Up
                  </Link>
                  <Link className="nav-link links" to="/SignIn">
                    Sign In
                  </Link>
                </>
              ) : null}

              {this.props.isAuth ? (
                <>
                  {!this.props.saveState ? (
                    <Link className="nav-link btn btn-primary" to="/NewPark">
                      New Park
                    </Link>
                  ) : null}
                  <Link className="nav-link" to="/" onClick={this.signOut}>
                    Sign Out
                  </Link>
                </>
              ) : null}
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        {/* <nav className="navbar navbar-expand-sm w-100">
          <Link className="navbar-brand links" to="/">
            SecPark
          </Link>
          <div className="collapse navbar-collapse">
            <ul className="navbar-nav ml-auto">
              {!this.props.isAuth ? (
                <>
                  <li className="nav-item">
                    <Link className="nav-link links" to="/SignUp">
                      Sign Up
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link links" to="/SignIn">
                      Sign In
                    </Link>
                  </li>
                </>
              ) : null}

              {this.props.isAuth ? (
                <>
                  {!this.props.saveState ? (
                    <li className="nav-item">
                      <Link className="nav-link btn btn-primary" to="/NewPark">
                        New Park
                      </Link>
                    </li>
                  ) : null}
                  <li className="nav-item">
                    <Link className="nav-link" to="/" onClick={this.signOut}>
                      Sign Out
                    </Link>
                  </li>
                </>
              ) : null}
            </ul>
          </div>
        </nav> */}
      </div>
    );
  }
}

function MapStateToProps(state) {
  return {
    isAuth: state.auth.isAuthenticated
  };
}

export default connect(
  MapStateToProps,
  actions
)(Header);
